import { Link } from 'react-router-dom'
import "./Training.css"

function Training({id,entitate, denumire, data, speaker}){
    return(
        <article className='training'>
            <h1>{denumire}</h1>
            <h3>{data}</h3>
            <h2>{speaker}</h2>
            <Link to={`/dashboard/training/${entitate}/${id}`} className="feedback" style={{ textDecoration: 'none' }}>Feedback</Link>
        </article>
    )
}

export default Training
